  false,\n\t\"url\": null,\n\t\"notes\": \"This airborne LiDAR terrain mapping data
  was acquired in the spring of 2001. The data were collected for the floodplain mapping
  program for the state of North Carolina. The data were collected for the state in
  three phases: 1, 2, and 3. This metadata record describes that data that were in
  phase 1 of collection and fall within the Cape Fear and Lumber River Basins in central
  and eastern North Carolina. This area consists of 30 counties which are listed below
  in the Place Keywords field. The data were received by the NOAA Coastal Services
  Center from the U.S. Geological Survey (USGS) Center for Lidar Coordination and
  Knowledge (CLICK). For data storage and Digital Coast provisioning purposes, the
  CSC converted the data to geographic coordinates and ellipsoid (Geoid99) elevations.
  The data are unclassified.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
